import "./App.css";
import { Route } from "react-router-dom";
import Home from "./pages/Home";
import chats from "./pages/chats";
function App() {
  return (
    <div className="App">
      <Route path="/" component={Home} />
      <Route path="/chats" component={chats} />
    </div>
  );
}

export default App;
